'use strict';

	$(function(){
		$('#taskCreate').on('keypress',function(e){
			if(e.which === 13){
				var clone = $(e.target).clone(true);
				clone.css({'margin-top' : 5}).removeAttr('id');
				$(e.target).after(clone);
				$(e.target).val('').focus();
			}
		});
		
		$('.task').on('keydown',function(e){
			
			if(e.which === 46 && $(e.target).attr('id') !== 'taskCreate'){
				
				if($(e.target).prev().hasClass('task')){
					$(e.target).prev().focus()
				}
				$(e.target).remove();
				
			}
		});
	});

document.getElementById('send').addEventListener('click', sendPriority);
$('#dueDate').datetimepicker();

$('#clientSelect').select2({
    ajax: {
        url: 'https://www.yallahq.com/app/clients/get-list',
        dataType: "json",
        delay: 250,
        data: function(e) {
            return { q: e.term, page: e.page }
        },
        processResults: function(e, t) {
            return t.page = t.page || 1, { results: e.items, pagination: { more: 30 * t.page < e.total_count } }
        },
        cache: !0
    },
    minimumInputLength: 1,
    placeholder: 'Select a client',
    templateResult: function(e) {
        return e.id ? e = $('<span><img src="' + e.img + '" class="img-circle" width="24" height="24" /> ' + e.text + "</span>") : e.text
    }
});
$('#userSelect').select2({
    ajax: {
        url: 'https://www.yallahq.com/app/profiles/get-list?guests=1',
        dataType: "json",
        delay: 250,
        data: function(e) {
            return { q: e.term, page: e.page }
        },
        processResults: function(e, t) {
            return t.page = t.page || 1, { results: e.items, pagination: { more: 30 * t.page < e.total_count } }
        },
        cache: !0
    },
    minimumInputLength: 1,
    placeholder: 'Select a user',
    templateResult: function(e) {
        return e.id ? e = $('<span><img src="' + e.img + '" class="img-circle" width="24" height="24" /> ' + e.text + "</span>") : e.text
    }
});



function sendPriority() {

    var title = document.getElementById('priority').value;

    if (title == '') {
        remindTitle();
        return;
    }

    var description = document.getElementById('description').value;
    var dueDate = document.getElementById('dueDate').value.toString();
    var user_id = '';
    var client_id = '';
    var tasks = '';

    if (document.getElementById('userSelect').value != 'Me') {
        user_id = document.getElementById('userSelect').value;
    }
    if (document.getElementById('clientSelect').value != 'None') {
        client_id = document.getElementById('clientSelect').value;
    }
        tasks = collectTasks();

    var priority = 'title=' + title + '&description=' + description + '&due=' + dueDate + '&user_id=' + user_id + '&client_id=' + client_id + '&tasks=' + tasks;

    chrome.storage.sync.get('key', function(data) {

        var APIkey = data.key;

        var request = new XMLHttpRequest();
        request.open('POST', 'https://www.yallahq.com/api/v1/priority?');
        request.setRequestHeader('Content-Type', 'application/x-www-form-urlencoded');
        request.setRequestHeader('API_KEY', APIkey);


        request.addEventListener('load', function() {

            document.getElementById('send').innerText = 'Priority sent!';
            setTimeout(function(){
               document.location.reload();
            }, 1500);
            
        });

        request.addEventListener('error', function() {
            document.getElementById('send').classList.add('error');
            document.getElementById('send').innerText = 'Error';
            setTimeout(function(){
                document.location.reload();
            }, 1500);
        });

        request.send(priority);

    });


    function remindTitle() {
        document.getElementById('priority').focus();
        var statusArea = document.getElementById('titleCheck');
        statusArea.innerText = 'Please enter a priority title';
        setTimeout(function() {
            statusArea.innerText = '';
        }, 2000);
        return;
    }

    function collectTasks() {
        var string = '';

        var tasks = document.getElementsByClassName('task');

        for (var i = 0; i < tasks.length; i++) {
            if (tasks[i].value != '') {
                string += tasks[i].value;
                string += ',';
            }
        }

        string = string.slice(0, -1);

        return string;
    }

}

